\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI never wanted to run a company,” he said a few minutes later. “To me a business is a good vehicle for getting stuff done.”\n\nJanuary 7, 2017\n\u001c16\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn his own Facebook profile he lists his interests: “openness, breaking things, revolutions, information flow, minimalism, making things, eliminating desire for all that really doesn’t matter.”\n\nJanuary 10, 2017\n\u001c17\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cit has always been explicitly conceived and engineered by Zuckerberg and colleagues as a tool to enhance your relationships with the people you know in the flesh—your real-world friends,\n\nJanuary 10, 2017\n\u001c17\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cacquaintances, classmates, or co-workers. As this book explains in detail, this is a core difference between Facebook and other similar services—and has introduced a particular set of challenges for the company at every turn.\n\nJanuary 10, 2017\n\u001c17\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI mean, picture yourself—you’re in college,” he began. “You spend all your time studying theories, right? And you think about things in this abstract way. Very idealistic. Very liberal at this institution. So a lot of these values are just around you: the world should be governed by people. A lot of that stuff has really shaped me. And this is a lot of what Facebook is pushing for. “Dustin [Moskovitz] and Chris [Hughes] [his Harvard roommates] and I would sit around and talk with other people I was taking computer science classes with. And we’d talk about how we thought that the added transparency in the world, all the added access to information and sharing [enabled by the Internet] would inevitably change big-world things. But we had no idea we would play a part in it.…We were just a group of college kids.” Then he describes what happened once Thefacebook launched: “Little by little—‘Oh, more schools want this’; and ‘Okay, more types of people want this.’…And it just kept getting wider and wider, and we just went, ‘Wow.’\n\nJanuary 10, 2017\n\u001c20\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Then one day it kind of hit us that we could play a leading role in making this happen and pushing it forward.…And what seemed obvious to my group of friends who were just armchair intellectuals talking about this in college—about how transparency coming from people would transform how the world works and how institutions were governed—it was like, ‘Hey, maybe other people aren’t actually pushing this, and maybe it takes this group of people who grew up thinking these things and having these values to push it forward. Maybe we shouldn’t give up.’” And he laughs.\n\nJanuary 10, 2017\n\u001c20\n\u0011\n\u0011\n\n\n1 The Beginning\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 10, 2017\n\u001c24\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCourse Match, an innocent enough project. He did it just for fun. The idea was to help students pick classes based on who else was taking them. You could click on a course to see who was signed up, or click on a person to see the courses he or she was taking. If a cute girl sat next to you in Topology, you could look up next semester’s Differential Geometry course to see if she had enrolled in that as well, or you could just look under her name for the courses she had enrolled in. As Zuckerberg said later, with a bit of pride at his own prescience, “you could link to people through things.” Hundreds of students immediately began using Course Match. The status-conscious students of Harvard felt very differently about a class depending on who was in it. Zuckerberg had written a program they wanted to use.\n\nJanuary 10, 2017\n\u001c24\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHis tendency was to say nothing until others fully had their say. He stared. He would stare at you while you were talking, and stay absolutely silent. If you said something stimulating, he’d finally fire up his own ideas and the words would come cascading out. But if you went on too long or said something obvious, he would start looking through you\n\nJanuary 10, 2017\n\u001c25\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1NfxbS0oCd7k6fyTgCWRZ9dhZNxC7BxQMvFvo9to","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"18arP7eWHUUeg1PxzAy2WJm67lX_aco70tX4xosE","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1RWDUmjnPQiD