se,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4163,"ei":4168,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="guUivVQ3eBFRZL9G8xW2w3fup0E"  nonce="guUivVQ3eBFRZL9G8xW2w3fup0E">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="guUivVQ3eBFRZL9G8xW2w3fup0E"  nonce="guUivVQ3eBFRZL9G8xW2w3fup0E">DOCS_modelChunk = [{"ty":"is","ibi":4169,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEmboldened by the unexpected success of Course Match, Zuckerberg decided to try out some other ideas. His next project, in October, he called Facemash. It gave the Harvard community its first look at his rebellious irreverent side. Its purpose: figure out who was the hottest person on campus.\n\nJanuary 10, 2017\n\u001c28\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOn the afternoon of Wednesday, February 4, 2004, Zuckerberg clicked a link on his account with Manage.com. Thefacebook.com went live. Its home screen read: “Thefacebook is an online directory that connects people through social networks at colleges. We have opened up Thefacebook for popular consumption at Harvard University. You can use Thefacebook to: Search for people at your school; Find out who are in your classes; Look up your friends’ friends; See a visualization of your social network.” Zuckerberg labeled himself user number four. (The first three accounts were for testing.) User number five was roommate Hughes; number six was Moskovitz; and number seven was Saverin. Zuckerberg’s friend and classmate Andrew McCollum designed a logo using an image of Al Pacino he’d found online that he covered with a fog of ones and zeroes—the elementary components of digital media.\n\nJanuary 12, 2017\n\u001c36\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo sign up, you created a profile with a single picture of yourself, along with a bit of personal information. You could indicate your relationship status. Pick one from the drop-down menu: single, in a relationship, or in an open relationship. You could include your phone number, AIM username, and email address; indicate which courses you were taking (a feature inspired by Course Match); favorite books, movies, and music; clubs you belonged to; political affiliation: very liberal/liberal/moderate/conservative/very conservative/apathetic; and a favorite quote. Thefacebook had no content of its own. It was merely a piece of software—a platform for content created by its users. Privacy controls were part of the original design. And there were some big restrictions: you couldn’t join unless you had a Harvard.edu email address, and you had to use your real name. That made Thefacebook exclusive, but it also ensured that users were who they said they were\n\nJanuary 12, 2017\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce you set up your own profile, the interaction began. It was pretty limited. After you invited others to be your friend,\n\nJanuary 12, 2017\n\u001c38\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyou could see a diagram of your social network, which showed all the people you were connected to. You could also direct something called a “poke” at other users by simply clicking on a link on their page. When you did, an indication would show up on their home page. What did that mean? Here’s the insouciant answer Zuckerberg posted on the site: “We thought it would be fun to make a feature that has no specific purpose.…So mess around with it, because you’re not getting an explanation from us.” Much activity on Thefacebook from the beginning was driven by the hormones of young adults. It asked you whether you were “interested in” men or women. In addition to giving you the option to list whether you were in a relationship, you were asked to fill in a section labeled “Looking for.” One frequently chosen option was “Random play.” When you poked someone, an indication of that simply showed up on their profile. That person could poke you back. For at least some, the interaction had a distinctly sexual meaning. This was college, after all.\n\nJanuary 12, 2017\n\u001c38\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnother feature was timely for many students. You could click on a course and see who was taking it, just as in Course Match. At Thefacebook’s launch, students were in the middle of choosing courses for the following semester. It was what’s called “shopping week” at Harvard, when classes have begun but students can add or drop them at will. For any Harvard student who picked his or her courses partly based on who\n\nJanuary 12, 2017\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001celse was in class, this feature of Thefacebook was immediately useful. It helps explain the rapid spread of Thefacebook in its early days, and also why Zuckerberg launched it that week\n\nJanuary 12, 2017\n\u001c39\n\u0011\n\u0011"},{"ty":"te","id":"i.10","spi":4178},{"ty":"te","id":"i.11","spi":4509},{"ty":"te","id":"i.12","spi":5431},{"ty":"te","id":"i.13","spi":6432},{"ty":"te","id":"i.14","spi":6593},{"ty":"te","id":"i.15","spi":7681},{"ty":"te","id":"i.16","spi":8135},{"ty":"as","st":"paragraph","si":4169,"ei":4169,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4170,"ei":4170,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":tr