acemash, he emphasized to the Crimson that he was “careful…to make sure that people don’t upload copyrighted material.” The Crimson did a little probing about his motives: “Zuckerberg…said he did not create the Website with the intention of generating revenue.…‘I’m not going to sell anybody’s e-mail address,’ he said. ‘At one point I thought about making the Website so that you could upload a resume too, and for a fee companies could search for Harvard job applicants. But I don’t want to touch that. It would make everything more serious and less fun.’” Making Thefacebook fun was more important than making it a business. It was a statement that would reverberate down through the short history of Facebook\n\nJanuary 12, 2017\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOne of my roommates was ‘Hey, I’ll help you!’ I said ‘Dude! You can’t program!’ So he went home for the weekend and bought the book PERL for Dummies and said ‘Now I’m ready.’ I said ‘Dude, the site’s not written in PERL.’” Regardless, Zuckerberg adjusted the ownership of Thefacebook to give the eager Moskovitz 5 percent. He reduced his own stake slightly to 65 percent and Saverin’s to 30 percent. Moskovitz’s main job was to spearhead expansion to other campuses.\n\nJanuary 12, 2017\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cZuckerberg had a burning desire to try new things, but his ability to create a fast-growing website in his spare time had a lot to do with where he was situated. “Having genius and ambition alone isn’t going to get you there. It’s really important to be lucky,” says Moskovitz.\n\nJanuary 12, 2017\n\u001c46\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cany individual student is within two degrees of everybody else on a given campus.” On average, students are separated from each other by no more than one intermediary relationship. “That’s why Thefacebook grew so well in college,” explains Moskovitz. He got an A in the statistics class, which wasn’t bad considering that the majority of his time that semester was spent working on the site. “And I got a bunch of sweet-ass bonus points for the data set,” Moskovitz remembers with relish.\n\nJanuary 12, 2017\n\u001c47\n\u0011\n\u0011\n\n\n2 Palo Alto\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe don’t like these either but they pay the bills.” Says Joshua Iverson, a sales rep who worked for Black at Y2M: “Mark never wanted ads. Eduardo was the businessperson.” Of course it wasn’t unusual for contemporary Web thinkers to be uninterested in advertising. Sites like Craigslist and Wikipedia were at that time rapidly becoming among the Internet’s largest by taking a patently noncommercial approach\n\nJanuary 12, 2017\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMoskovitz is the kind of person every start-up needs—diligent, down-to-earth, versatile, and pragmatic. He took responsibility for keeping the service operating and setting up databases for new schools (with the interns doing much of the tedious work). If he had to, he’d work all night to keep the system up.\n\nJanuary 13, 2017\n\u001c58\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHaving the two of them in place meant Zuckerberg could do what he does best—think about what Thefacebook should be and how it should evolve. Or, depending on his mood, devote his energies to something he wanted to use himself—Wirehog. Ironically, Zuckerberg was not a heavy user of Thefacebook. Nor, in fact, were any of its founders and early employees. This summer the interns, working with Moskovitz, started to gather data on how people actually used the site. They found that some users were looking at hundreds and even thousands of profiles every day. These were the users they were designing for.\n\nJanuary 13, 2017\n\u001c59\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe leader of a company needs to have a decision tree in his head—if this happens we go this way, but if it winds up like that, then we go this other way. Mark does that instinctively.” He liked to have fun as much as any of his colleagues—in fact he could be a bit of a comic—but he also was determined to keep this ship moving forward.\n\nJanuary 13, 2017\n\u001c61\n\u0011\n\u0011"},{"ty":"te","id":"i.17","spi":8357},{"ty":"te","id":"i.18","spi":9230},{"ty":"te","id":"i.19","spi":9734},{"ty":"te","id":"i.20","spi":10049},{"ty":"te","id":"i.21","spi":10589},{"ty":"te","id":"i.22","spi":11034},{"ty":"te","id":"i.23","spi":11381},{"ty":"te","id":"i.24","spi":12023},{"ty":"as","st":"paragraph","si":8348,"ei":8348,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8349,"ei":8349,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8350,"ei":8350,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":8352,"ei":8352,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":8354,"ei":8354,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":8356,"ei":8356,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":8358,"ei":8358,"sm":{"ps_klt_i":