ay no—evoking a vision very clearly, getting everybody excited about it, but knowing where to draw the line, especially with products. You can’t do everything. And that’s a lesson Mark didn’t know yet. That’s a lesson Mark learned.” Work was hardly the onl\n\nJanuary 13, 2017\n\u001c64\n\u0011\n\u0011\n\n\n3 Social Networking and the Internet\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cClub Nexus was revolutionary and had a raft of features—probably too many. It allowed members to create a profile using their real names, and then list their best on-campus friends, who were known as “buddies” in Club Nexus lingo. Buddies who were not already members then automatically received an email inviting them to join the service. Only students with a Stanford-issued email address could join, and that email authentification ensured that each person was who they said they were. You could chat, invite friends to events, post items in a classifieds section including personal ads, write bloglike columns, and use a sophisticated search function to find people with similar interests. Students used it to find study partners, running buddies, and dates. Buyukkokten himself once bragged that what made it different from any other website was “you can create really big parties.” Within six weeks Club Nexus had 1,500 members at Stanford, whose student body totaled about 15,000. But after it reached about 2,500, usage leveled off. The service was just too complicated. Buyukkokten was a talented programmer who had loaded it with every interesting feature he could think of. But that made it difficult to use and diffused activity among many different features. You didn’t get the sense there were many others in there with you.\n\nMay 9, 2017\n\u001c89\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut Zuckerberg said he didn’t want to do that because houseSYSTEM was “too useful,” according to the book. Greenspan writes that this statement confused him. “It just does too much stuff,” Zuckerberg continued, according to the book. “Like, it’s almost overwhelming how useful it is.” Today, Zuckerberg won’t say much about houseSYSTEM, except that “the trick isn’t adding stuff, it’s taking away.” houseSYSTEM eventually disappeared. Zuckerberg classmate Sam Lessin, himself a programmer and now an Internet entrepreneur, recalls it as “a huge sprawling system that could do all sorts of things.” By contrast, he says, Thefacebook was almost obsessively minimal. “The only thing you could do immediately was invite more friends. It was that pureness which drove it.”\n\nMay 9, 2017\n\u001c95\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThefacebook launched on February 4.\n\nMay 9, 2017\n\u001c95\n\u0011\n\u0011\n\n\n4 Fall 2004\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLook at the world around you. With the slightest push—in just the right place—it can be tipped.” As the fall semester of 2004 loomed, Thefacebook was on the verge of a serious crisis. Over the summer, membership had almost doubled from about 100,000 to 200,000. That was good and bad. “We were just lucky it wasn’t completely bringing down the architecture,” says Dustin Moskovitz, who spent as much time as anyone working to keep that from happening. “Our servers were already stretched, but we knew a full load in the fall would be double that. Service got really unstable.”\n\nMay 9, 2017\n\u001c99\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFriending” had an element of competitiveness from day one, as it had on Friendster and MySpace. If your roommate had 300 friends and you only had 100, you resolved to do better. “Competition definitely caused Thefacebook to spread faster at Dartmouth,” says Susan Gordon, class of 2006. She was on an Italian study program in Rome when Thefacebook blanketed Dartmouth almost overnight in March 2004. She immediately began receiving emails from friends telling her that she had to join, otherwise she would be way behind when she returned at the end of the quarter. “It made a lot of sense to all of us immediately,” she says. “An online green book—how fun!” (Dartmouth’s facebook had a green cover.) The fact that it was Ivy League–only was also reassuringly exclusive. It had started at Harvard. It must be okay\n\nMay 9, 2017\n\u001c105\n\u0011\n\u0011"},{"ty":"te","id":"i.25","spi":12398},{"ty":"te","id":"i.26","spi":12823},{"ty":"te","id":"i.27","spi":14194},{"ty":"te","id":"i.28","spi":14994},{"ty":"te","id":"i.29","spi":15076},{"ty":"te","id":"i.30","spi":15685},{"ty":"as","st":"paragraph","si":12389,"ei":12389,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":12390,"ei":12390,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":12391,"ei":12391,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":12393,"ei":12393,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":12395,"ei":12395,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":12397,"ei":12397,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":12399,"ei":12399,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":tru