:"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":15657,"ei":15669,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":15688,"ei":16501,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":16502,"ei":16514,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="guUivVQ3eBFRZL9G8xW2w3fup0E"  nonce="guUivVQ3eBFRZL9G8xW2w3fup0E">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="guUivVQ3eBFRZL9G8xW2w3fup0E"  nonce="guUivVQ3eBFRZL9G8xW2w3fup0E">DOCS_modelChunk = [{"ty":"is","ibi":16522,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyourself a more attractive potential friend occupied a considerable amount of time for many of these newly networked Ivy Leaguers. Find exactly the right picture. Change it regularly. Consider carefully how you describe your interests. Since everyone’s classes were listed, some students even began selecting what they studied in order to project a certain image of themselves.\n\nMay 9, 2017\n\u001c105\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYour “facebook,” as profiles on the service began to be called, increasingly became your public face. It defined your identity. People spent hours and hours visiting the profiles of other students, initially just at their own school but soon across Thefacebook’s network at other elite campuses as well\n\nMay 9, 2017\n\u001c106\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere wasn’t that much you could do there except maintain your own profile, add friends, poke people, and view the profiles of others. Nonetheless, students spent thousands of hours examining every nook and cranny of others’ profiles. You could ask Thefacebook to display ten random students from your school for you to peruse, or you could search for people based on various parameters. The latent nosiness and prurience of an entire generation had been engaged.\n\nMay 9, 2017\n\u001c106\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstudents even more reason to spend time there. Now included on user profiles was something called “the wall,” which allowed anyone to write whatever they wanted right on your profile. It could be a message to you or a comment about you—the equivalent of a public email. Any visitor to your profile could see it. Now not only could you surf around examining people, but you could react to what you learned. Or you could simply invite someone to meet you in the cafeteria later. Or make a seductive comment. And another friend could comment on that comment in his or her own post to the wall. Suddenly every Thefacebook user had their\n\nMay 9, 2017\n\u001c106\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cown public bulletin board. Over the summer, Zuckerberg, Moskovitz, and Parker had coined a term for how students seemed to use the site. They called it “the trance.” Once you started combing through Thefacebook it was very easy to just keep going. “It was hypnotic,” says Parker. “You’d just keep clicking and clicking and clicking from profile to profile, viewing the data.” The wall was intended to keep users even more transfixed by giving them more to see inside the service. It seemed to work. Almost immediately the wall became Thefacebook’s most popular feature\n\nMay 9, 2017\n\u001c107\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat was so bizarre about the way Facebook was unfolding at that point,” says Sean Parker, “is that Mark just didn’t totally believe in it and wanted to go and do all these other things.” Zuckerberg felt he had cause to hedge his bets. He was worried that once Thefacebook began trying to expand beyond college it would hit a wall of resistance. He was genuinely unsure which of his projects would ultimately lead to the best business. And it wasn’t just about business. Zuckerberg hadn’t changed much since he was just out of Exeter and turned down millions for\n\nJune 13, 2017\n\u001c113\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSynapse, the MP3-playing tool he built with D’Angelo. The ideas were at least as interesting as the prospect of riches.\n\nJune 13, 2017\n\u001c113\n\u0011\n\u0011"}
}'


